webpackJsonp([0xcd0cf9d7b1dd],{961:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2007-06-07-2008-trek-madone-prices/index.md absPath of file >>> MarkdownRemark",html:'<p>UPDATE: <a href="http://www.justinball.com/2008/04/18/bought-the-trek-madone-69/">I bought a Madone 6.9</a></p>\n<p>UPDATE: <a href="http://www.justinball.com/2008/04/29/first-real-ride-on-the-new-trek-madone-69/">Here\'s my first ride and first review of my new 2008 Trek Madone 6.9</a></p>\n<p>As a follow up to <a href="http://www.justinball.com/2007/06/06/2008-trek-madone/">my 2008 Trek Madone post</a> I have some prices.</p>\n<p>I am sure the price will vary from shop to shop, but here\'s what I found out:\nPro Series\n6.9 $8399\n6.5 $5829\n5.5 $4180</p>\n<p>Performance Series\n6.9 $7700\n6.5 $5830\n5.5 $4180\n5.2 $3520</p>\n<p>A couple of the Trek shops might have a couple of these bikes in stock, but from the people I have talked to don\'t expect to see the bikes enmass until the August-October time frame.</p>',frontmatter:{title:"2008 Trek Madone prices",date:"June 07, 2007",imageUrl:null,image:null}}},pathContext:{path:"/2008-trek-madone-prices"}}}});
